import './App.css';
import Header from './components/Header';
import HomeStart from './components/HomeStart';
import Explore from './components/Explore';
import Treasures from './components/Treasures';
import Profile from './components/Profile';
import Footer from './components/Footer';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import { Slide, Slider } from './Slider';
import image1 from './images/Slides/image_1.jpg';
import image2 from './images/Slides/image_2.jpg';
import image3 from './images/Slides/image_3.jpg';
import image4 from './images/Slides/image_4.jpg';
import image5 from './images/Slides/image_5.jpg';


function App() {
  return (
    <Router>
    <div className="App">
      <Header />

      <Switch>
      <Route path="/" exact component={HomeStart} />
      <Route path="/explore" exact component={Explore} />
      <Route path="/treasures" exact component={Treasures} />
      <Route path="/profile" exact component={Profile} />
      </Switch>

      <div className="container">
                <Slider showNav>
                    <Slide bg={image1}></Slide>
                    <Slide bg={image2}></Slide>
                    <Slide bg={image3}></Slide>
                    <Slide bg={image4}></Slide>
                    <Slide bg={image5}></Slide>
                </Slider>
            </div>

      <Footer />
    </div>
    </Router>
  );
}

export default App;
